import { createBrowserRouter, Outlet, RouterProvider } from "react-router-dom";
import Layout from "../Layout";
import AdminRoutes from "./adminRoutes";
import NotFound from "../component/NotFound/NotFound";
import Home from "../component/Home/Home";
import Cart from "../component/cart/Cart";
import Auth from "../component/Auth/Auth";
import Profile from "../component/profile/Profile";
import UserProfile from "../component/profile/UserProfile";
import Orders from "../component/profile/Orders";
import Favourites from "../component/profile/Favourites";
import Address from "../component/profile/Address";
import Events from "../component/profile/Address";
import { Logout } from "@mui/icons-material";
import { useSelector } from "react-redux";
import CreateRestaurantForm from "../Admin/AddRestaurants/CreateRestaurantForm";
import Admin from "../Admin/Admin";
import RestaurantDashboard from "../Admin/Dashboard/RestaurantDashboard";
import Navbar from "../component/navbar/Navbar";


const CustomerLayout = () => {
    return (
        <div className="relative">
            <nav className="sticky top-0 z-50">
                <Navbar />
            </nav>
            <Outlet />
        </div>
    );
};



const router = () => {


    const router = createBrowserRouter([
        {
            path: "admin/restaurant",
            element:
                !restaurant.usersRestaurant ?
                    <CreateRestaurantForm /> :
                    <Admin />,
            children: [{
                index: 'restaurant', element: <RestaurantDashboard />
            }]
        },
        {
            path: '/',
            element: <Layout />,
            errorElement: <NotFound />,
            children: [
                { index: true, element: <Home /> },
                { path: "cart", element: <Cart /> },
                {
                    path: "account", element: <Home />,
                    children: [
                        { path: "login", element: <Auth /> },
                        { path: "register", element: <Auth /> },
                    ]
                },
                {
                    path: "my-profile",
                    element: <Profile />,
                    children: [
                        { index: true, element: <UserProfile /> },
                        { path: "order", element: <Orders /> },
                        { path: "favourite", element: <Favourites /> },
                        { path: "address", element: <Address /> },
                        { path: "events", element: <Events /> },
                        { path: "logout", element: <Logout /> },
                    ]
                }
            ]
        }
    ]);
    return <RouterProvider router={router} />
}
